rated file we need to\n      // manually revoke the object URL to avoid memory leaks.\n      if (textFile !== null) {\n        window.URL.revokeObjectURL(textFile);\n      }\n\n      textFile = window.URL.createObjectURL(data);\n\n      return textFile;\n    };\n\n    var link = document.createElement('a');\n    // link.setAttribute('download', 'exoplots_download.txt');\n    link.setAttribute('target', '_blank');\n    link.href = makeTextFile(makeCSV(sources, keys, header));\n    document.body.appendChild(link);\n\n    // wait for the link to be added to the document\n    window.requestAnimationFrame(function() {\n      var event = new MouseEvent('click');\n      link.dispatchEvent(event);\n      document.body.removeChild(link);\n    });\n    "},"id":"1130","type":"CustomJS"},{"attributes":{"end":104.48099735525327,"start":0.020595653299337137},"id":"1114","type":"Range1d"},{"attributes":{"callback":{"id":"1113"}},"id":"1034","type":"TapTool"},{"attributes":{"overlay":{"id":"1158"}},"id":"1131","type":"BoxSelectTool"},{"attributes":{},"id":"1004","type":"DataRange1d"},{"attributes":{"overlay":{"id":"1024"}},"id":"1020","type":"BoxZoomTool"},{"attributes":{},"id":"1099","type":"Selection"},{"attributes":{"button_type":"primary","icon":null,"js_event_callbacks":{"button_click":[{"id":"1130"}]},"label":"Download CSV of Selected Data"},"id":"1129","type":"Button"},{"attributes":{},"id":"1023","type":"HelpTool"},{"attributes":{"bottom_units":"screen","fill_alpha":0.5,"fill_color":"lightgrey","left_units":"screen","level":"overlay","line_alpha":1.0,"line_color":"black","line_dash":[4,4],"line_width":2,"right_units":"screen","top_units":"screen"},"id":"1024","type":"BoxAnnotation"},{"attributes":{"fill_alpha":{"value":0.35},"fill_color":{"value":"#228833"},"line_alpha":{"value":0.35},"line_color":{"value":"#228833"},"marker":{"value":"circle_cross"},"x":{"field":"insolation"},"y":{"field":"radius"}},"id":"1038","type":"Scatter"},{"attributes":{"axis":{"id":"1014"},"dimensi
